def list_to_csv(data, csv_file_path):
    # Abre el archivo CSV para escribir
    with open(csv_file_path, mode='w', newline='', encoding='utf-8') as csv_file:
        writer = csv.writer(csv_file)
        
        # Escribe cada fila de la lista en el archivo CSV
        for row in data:
            writer.writerow(row)
    
    print(f'El archivo CSV ha sido guardado en {csv_file_path}')

